import './cart.css'
import Header from '../../components/header/Header'
import ExHeader from '../../components/ExHeader/ExHeader'
import Products from '../../components/Product/Product'


const Cart = () => {
    return (
        <>
        <Header />
        
        <div className="container">
            <div className="cart">
                <span>КОРЗИНА</span>
                <Products />
            </div>
           
        </div>
        
        </>
    );
}

export default Cart;
